: 1.0\n\neureka:\n  instance:\n    preferIpAddress: true\n  client:\n    serviceUrl:\n#      defaultZone: http://localhost:8762/eureka\n      defaultZone: http://wolf:abc123@10.10.101.18:8762/eureka\n  #自定义服务名配置\n  server-name:\n    eureka-server-name1: SPRINGCLOUD-EUREKA\n\nfeign:\n  hystrix:\n    enabled: true\n\nturbine:\n  app-config: springcloud-ribbon #配置Eureka中的serviceId列表，表明监控哪些服务\n  aggregator:\n    cluster-config: default #指定聚合哪些集群，多个使用”,”分割，默认为default。\n  cluster-name-expression: new String(\"default\")\n\nhystrix:\n  command:\n#    FeignTestInterface#test0():  针对与FeignTestInterface接口中test0方法设置超时\n#      execution:\n#        isolation:\n#          thread:\n#            timeoutInMilliseconds: 20000\n    default:\n      execution:\n        isolation:\n          thread:\n            timeoutInMilliseconds: 20000\n\n#对于Hystrix的限流的两种策略\n          strategy: THREAD #线程池隔离 默认就是THREAD，还有一个是信号量隔离SEMAPHORE\n          semaphore:\n            maxConcurrentRequests: 10 #设置最大的信号量，只对于使用信号量[SEMAPHORE]策略的生效 ，默认是10\n\n  threadpool: #这种设置方式针对于使用[THREAD]策略的生效\n    default:\n      coreSize: 15 #执行线程数 默认是10\n      maxQueueSize: 1  #设置使用哪种BlockingQueue，如果-1为SynchronousQueue；其他则为LinkedBlockingQueue 默认是-1\n      queueSizeRejectionThreshold: 5  #设置拒绝队列大小，这个属性是因为maxQueueSize无法动态改变，但需要去动态改变队列大小\n                                      #默认是5，当maxQueueSize为-1时，该属性不可用\n\n\n#线程池：适合绝大多数的场景，99%的，线程池，对依赖服务的网络请求的调用和访问，timeout这种问题\n#信号量：适合，你的访问不是对外部依赖的访问，而是对内部的一些比较复杂的业务逻辑的访问，但是像这种访问，\n#      系统内部的代码，其实不涉及任何的网络请求，那么只要做信号量的普通限流就可以了，因为不需要去捕获timeout类似的问题，\n#      算法+数据结构的效率不是太高，并发量突然太高，因为这里稍微耗时一些，导致很多线程卡在这里的话，不太好，\n#      所以进行一个基本的资源隔离和访问，避免内部复杂的低效率的代码，导致大量的线程被夯住\n\n\n#ribbon配置格式为：${serverName}.ribbon.**\n# 或ribbon.**  （全局设置）\n#SPRINGCLOUD-EUREKA:\nribbon:\n  ReadTimeout: 10000\n  ConnectTimeout: 10000\n#  MaxAutoRetries: 1\n#  MaxAutoRetriesNextServer: 1\n#  ServerListRefreshInterval: 2000\n\n\n#spring.cloud.loadbalancer.retry.enabled: true\n#logging:\n#  path: E:/springcloud-learning-log/feign\n\n