  `storage_quotas` varchar(255) DEFAULT '' COMMENT '集群租户的所有存储配额信息（name1_quota1_total1，name2_quota2_total2...）',
  PRIMARY KEY (`id`),
  KEY `tenant` (`tenant_id`,`cluster_id`,`reserve1`) USING BTREE,
  KEY `cluster` (`cluster_id`,`reserve1`) USING BTREE
